{
    "@type": "MessageCard",
    "@context": "http://schema.org/extensions",
    "summary": "SAP Cloud ALM Notification",
    "sections": [
        {
            "activityTitle": "${property.Subject}"
        },
        {
            "facts": [
                {
                    "name": "Assignee Name",
                    "value": "${property.AssigneeName}"
                },
                {
                    "name": "Project",
                    "value": "${property.ProjectName}"
                },
                {
                    "name": "Task",
                    "value": "${property.Title}"
                },
                {
                    "name": "Due Date",
                    "value": "${property.DueDate}"
                },
                {
                    "name": "Involved Parties",
                    "value": "${property.InvolvedParties}"
                }
            ],
            "markdown": true
        }
    ]
}
